        =============================================

        [head=1]НАЧАЛО:[/head]

        1. Использование взрывчатки строго запрещено.

        2. Ваше право кооперироваться с дургими участниками.

        3. Чтобы указать на свою готовность - нажмите на кнопку у красной лампы (Горит - готов, иначе - нет).

        4. Намеренное нарушение структуры арены запрещено. Уничтожение ламп, шлюзов и утилизационных блоков будет караться.


        [head=1]Бой:[/head]

        1. Как только все учатники будут готовы - без предупреждения шлюзы откроются. Вы обязаны покинуть зону закупки как только шлюзы откроются.

        2. В первые 3 секунды боя разбегитесь по локации, во избежании быстрого устранения участника с самого начала раунда.

        3. Выживет только один игрок.


        [head=1]Конец резни:[/head]

        1. Все устаники обязаны переместиться обратно в зону закупки.

        2. Все участники обязаны сдать всё купленное в сброс(Утилизационный блок), кроме: Форма оперативника, ноуслипы, боевые перчатки и гарнитура-хамелеон, это ваш базовый набор, который обязан быть при вас.

